import styled from "styled-components";

const FullWidth = styled.div`
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const Center = styled.div`
  width: 100%;
`;

let Container = ({ children }) => {
  return (
    <FullWidth>
      <Center>{children}</Center>
    </FullWidth>
  );
};

export default Container;
